import React from 'react';
import './Navbar.css';

const Navbar = () => {
  return (
    <div className="container-menu">
        <div className="container-menu__name-user">
            ИМЯ
        </div>
        <div className="container-menu__btn">
            КНОПКА
        </div>
    </div>
  );
}

export default Navbar;
